import Yellow from './components/yellowblock.js';

let App = ()=> {
  return (
    <div className="App">
     hello
     <Red/>
     <Blue/>
     <Yellow/>
    </div>
  );
}
const mainarea=document.getElementById('root');
mainarea.appendChild(<Red/>,<Blue/>,<Yellow/>);
ReactDOM.render(
  {mainarea}
);
